import arrowDownIcon from "../../icons/arrow-down.svg"

const CatalogItem = () => {
    return(
        <div className="catalog-item">
            <h3 className="title">jj</h3>
            <img width={20} height={20} src={arrowDownIcon} alt="arrow" />
        </div>
    )
}

export default CatalogItem;
